/// converts Vec<SaveSnippet> to Vec<CodeSnippet>
fn convert_snippets(snippets: &[SaveSnippet]) -> Vec<CodeSnippet> {
    snippets
        .iter()
        .map(|snip| {
            CodeSnippet::new(
                snip.title.clone(),
                snip.desc.clone(),
                snip.code.clone(),
                snip.lang.clone(),
            )
        })
        .collect()
}
